import React from 'react'
import Container from './Container'

class Cart extends React.Component {
  render(){
    return (
      <div className="cart">
        <h1>Your cart: </h1>
        <Container cartMode={true} action={this.props.removeFromCart} items={this.props.items}/>
      </div>
    )
  }
}

export default Cart
